import './Mobile.css';

const Mobile = () => {
    return (
        <div>
            <img src='' alt="mobile"/>
            <h3>Brand Name : Iphone</h3>
            <h3>Battery : 3000mAh</h3>
            <h3>Size : 5.6 inches</h3>
            <h3>color : Blue</h3>
            <button>Delete</button>
        </div>
    )
}

export default Mobile;
